import React from "react";
import {
  AboutContainer,
  AboutBg,
  AboutContent,
  AboutH1,
  AboutP,
  AboutIconRow,
  AboutIcon,
  AboutGreeting,
} from "./AboutElms";
import CSS from "../../images/css.png";
import HTML from "../../images/html-5.png";
import JS from "../../images/js.png";
import PN from "../../images/python.png";
import PS from "../../images/ps.png";
import AI from "../../images/ai.png";
import MV from "../../images/magicavoxel.png";
import ND from "../../images/node-js.png";
import RT from "../../images/physics.png";
import MG from "../../images/mongo.png";
import EX from "../../images/express.png";

const About = () => {
  return (
    <AboutContainer id="about">
      <AboutBg>
        <AboutGreeting>
          <AboutH1>Hi, I'm Jacob.</AboutH1>
          <AboutH1> Nice to meet you.</AboutH1>
          <AboutP>
            My coding journey began in high school developing simple web and
            terminal applications. While learning the MERN Stack, I began to
            explore the world of automation. Building private use applications
            such as Discord Bots, Inventory Monitors, Account Generators as well
            as Autonomous Checkout. I have recently combined my passions for
            both art and development to work on various creative coding projects
            implementing both AI and algorithmic procedures.
          </AboutP>
        </AboutGreeting>
        <AboutContent>
          <AboutIconRow>
            <AboutIcon src={CSS} type="image/png" />
            <AboutIcon src={HTML} type="image/png" />
            <AboutIcon src={JS} type="image/png" />
          </AboutIconRow>
          <AboutIconRow>
            <AboutIcon src={MG} type="image/png" />
            <AboutIcon src={EX} type="image/png" />
            <AboutIcon src={RT} type="image/png" />
          </AboutIconRow>
          <AboutIconRow>
            <AboutIcon src={ND} type="image/png" />
            <AboutIcon src={PN} type="image/png" />
            <AboutIcon src={MV} type="image/png" />
          </AboutIconRow>
          <AboutIconRow>
            <AboutIcon src={PS} type="image/png" />
            <AboutIcon src={AI} type="image/png" />
          </AboutIconRow>
        </AboutContent>
      </AboutBg>
    </AboutContainer>
  );
};

export default About;

